import React from 'react'
import "./style.scss";
import {FaGithub,FaListUl,FaArrowUp} from 'react-icons/fa';
import {GrLinkedin,GrMail,GrContactInfo} from "react-icons/gr";
import {VscFileSubmodule, VscChecklist,VscAccount,VscArrowSmallUp} from "react-icons/vsc";
import {BsPersonSquare} from "react-icons/bs";


export default function Navbar() {
    return (
        <div className="navbar" data-scroll-section>
            <div id="menu">
                Menu
                <ul>
                    <li><VscArrowSmallUp/></li>
                    <li><VscAccount/></li>
                    <li><VscChecklist/></li>
                    <li><VscFileSubmodule/></li>
                    <li><GrContactInfo/></li>
                </ul>
            </div>
            <div id="icons">
                <a href="https://github.com/joicejoseph3198" target="_blank" rel="noopener noreferrer"><FaGithub id="git"/></a>
                <a href="https://www.linkedin.com/in/joice-v-joseph-85311a1a1/" target="_blank" rel="noopener noreferrer"><GrLinkedin id="linkd"/></a>
                <a href="your link here" target="_blank" rel="noopener noreferrer"><GrMail id="mail"/></a>
            </div>
        </div>
    )
}
